My Sisters Hot Friend ~ Misti Dawn 

may 12, 2011

Michael asks his sister's friend Misti to help him improve his video-game playing skills, but she's reluctant since he screwed up her game when he borrowed it. She gives him a few pointers, but he needs her to help him to actually play the game in order to get better at it. He says he'll do anything. We all know where this leads to...
